export default function Home() {
    return (
        <>
            <div class="img-wrapper">
                <img class="img-fluid" src={process.env.PUBLIC_URL + "/images/Jumbotron.png"} />
                    <div class="img-overlay" style={{backgroundColor:"white", padding:"10px"}}>
                        <button class="btn btn-md btn-success">Button</button>
                    </div>
            </div>
        </>
    )
}
